import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoginPage from './components/Login';
import Dashboard from './components/Dashboard';
import {Register} from './components/Register'; // Correct for default export
function App() {
  return (
    <Router> {/* Only one Router component here */}
      <Routes>
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<Register />} /> {/* Add the registration route */}
        <Route path="/dashboard/*" element={<Dashboard />} /> {/* Allow nested routes */}
        <Route path="/" element={<LoginPage />} /> {/* Default route */}
      </Routes>
    </Router>
  );
}

export default App;
